var Floor=function(){this.floorImage=null;this.position=new Vector(0,0);this.width=0};Floor.prototype.setFloorImage=function(a){this.floorImage=a.getImage("floorImage")};Floor.prototype.createFloor=function(){};Floor.prototype.draw=function(b){for(var a=0;a<this.width;a=a+32){b.drawImage(this.floorImage,a,this.position.y)}};Floor.prototype.setWidth=function(a){this.width=a};Floor.prototype.getTileWidth=function(){return this.floorImage.width};Floor.prototype.setPosition=function(a,b){this.position=new Vector(a,b)};